import React from 'react';
import styled from 'styled-components';
import logo from '../pictures/head.png';

const Styles = styled.div`

background: #eeeeee;
height: 30vh;

.Button {
  display: none;
}
img {
  width: 3em;
}

`

function Footer() {
  return (
    <Styles>
      <p>Barber Andrew</p>
      <img
        className="d-block p-3"
        src={logo}
        alt="logo"
      />

    </Styles>
  );



}

export default Footer;
